import UIKit

func productExceptSelf(_ nums: [Int]) -> [Int] {
    var n = nums.count
            var pref = [Int](Array(repeating: 1, count: n))
            var suff = [Int](Array(repeating: 1, count: n))
            var ans = [Int](Array(repeating: 1, count: n))
             for i in 1..<n {
                var j = (n - 1) - i
                 print(j)
                pref[i] = pref[i - 1] * nums[i - 1]
                 print(pref[i])
                suff[j] = suff[j + 1] * nums[j + 1]
                 print(suff[i])
            }
            for i in 0..<n {
                ans[i] = pref[i] * suff[i]
            }
            return ans
    
